import React from "react";
import "./Form.css";
export default class Progressbar extends React.Component {
  render() {
    return (
      <>
        <div className="progress">
          <div className="progress-bar" style={{ width: 70, color: red }}></div>
        </div>
      </>
    );
  }
}
